import React, {Component} from'react';

class Captchtest extends Component{
	render(){
		return(
			<div>
				<div className = 'Prompt'>Enter the Text</div>
				<div className = 'pass'>
				<input className = 'blank' type="text" onChange = {this.onEmailChange}/>
				</div>	
			</div>
		)
	}
}
export default Captchtest;
